import React from "react";
import { createBrowserRouter, RouterProvider } from 'react-router-dom';

import Register from '../Register/Register';
import LoginForm from '../Login/LoginForm';
import Homepage from '../Homepage/Homepage';
import Booking from '../Booking/Booking';
import CusData from '../CusData/CusData';
import Housing from '../Housing/Housing';
import Planner from '../Planner/Planner';
import HousingEdit from '../Housing/HousingEdit/HousingEdit';
import HousingAdd from '../Housing/HousingAdd/HousingAdd';
import HousingDel from '../Housing/HousingDel/HousingDel';
import UserProfile from "../UserProfile/UserProfile";
import ProfileEdit from "../UserProfile/ProfileEdit"
import ZoneEdit from "../Zoneing/ZoneEdit/ZoneEdit"
import ZoneAdd from "../Zoneing/ZoneAdd/ZoneAdd";
import ZoneDel from "../Zoneing/ZoneDel/ZoneDel";
import Zoneing from "../Zoneing/Zoneing";
import AddUser from "../User/AddUser/AddUser";
import EditUser from "../User/EditUser/EditUser";
import AddBooking from "../Booking/AddBooking";
import EditBooking from "../Booking/EditBooking";
import User from "../User/User";
import AboutUs from '../AboutUS/AboutUs';
import RootLayout from './Root';
import Errorpage from './Error';

  // const routerDefinitions = createRoutesFromElements(
  //   <Route>
  //     <Route path="/" element={<Homepage />}/>
  //     <Route path="/Login" element={<Login />}/>
  //     <Route path="/Register" element={<Register />}/>
  //   </Route>
  // );

  // const router = createBrowserRouter(routerDefinitions);

const router = createBrowserRouter([
    {
      path: '/',
      element: <RootLayout/>,
      errorElement: <Errorpage/>, 
      children: [
            { path: '/', element: <Homepage />},
            { path: '/Booking', element: <Booking />},
            { path: '/CusData', element: <CusData />},
            { path: '/Housing', element: <Housing />},
            { path: '/Planner', element: <Planner />},
            { path: '/HousingEdit/:Eid', element: <HousingEdit />},
            { path: '/AboutUs', element: <AboutUs />},
            { path: '/HousingAdd', element: <HousingAdd />},
            { path: '/HousingDel', element: <HousingDel />},
            { path: '/UserProfile', element: <UserProfile />},
            { path: '/ProfileEdit', element: <ProfileEdit />},
            { path: '/Zoneing', element: <Zoneing />},
            { path: '/ZoneDel', element: <ZoneDel />},
            { path: '/ZoneEdit', element: <ZoneEdit />},
            { path: '/ZoneAdd', element: <ZoneAdd />},
            { path: '/AddUser', element: <AddUser />},
            { path: '/EditUser', element: <EditUser />},
            { path: '/AddBooking', element: <AddBooking />},
            { path: '/EditBooking', element: <EditBooking />},
            { path: '/User', element: <User />},
            { path: '/Register', element: <Register />},
            { path: '/LoginForm', element: <LoginForm />},
          
      ],
    },

  ]);
 const Routers = () => {

  return (
    <RouterProvider router={router}/>

  );
}

export default Routers;
